import AuthenticationService from '@/services/AuthenticationService'

export default {
    data() {
        return {
            nickName: '',
            amountUSDT: 0,
            amountBTC: 0,
            amountETH: 0,
            amountPAYPAL: 0,
            amountVND: 0
        }
    },
    methods: {
       addMoney(){
           if(this.nickName == ''){
               return this.$vs.notify({
                    text:'Biệt danh không được rỗng!',
                    color:'warning',
                    iconPack: 'feather',
                    icon:'icon-check'
                });
           }
           let obj = {
               nick: this.nickName,
               aUSDT: this.amountUSDT,
               aBTC: this.amountBTC,
               aETH: this.amountETH,
               aPAYPAL: this.amountPAYPAL,
               aVND: this.amountVND
           }

           AuthenticationService.addMoneyMember(obj)
           .then((res) => {
                let d = res.data
                if(!d.success){
                    localStorage.removeItem('token');
                    this.$router.push('/pages/login').catch(() => {})
                }else{
                    // tránh tình trạng click nhìu lần sinh ra + nhiều
                    this.amountUSDT = 0;
                    this.amountBTC = 0;
                    this.amountETH = 0;
                    this.amountPAYPAL = 0;
                    this.amountVND = 0;

                    return this.$vs.notify({
                        text: `Trừ tiền cho tài khoản ${this.nickName} thành công.`,
                        iconPack: 'feather',
                        icon: 'icon-check',
                        color: 'success'
                    })
                }

           })
       }
    }
}
